DROP TABLE IF EXISTS "departamento";
CREATE TABLE departamento (id_depto INT PRIMARY KEY NOT NULL, nombredepto CHAR(50));
DROP TABLE IF EXISTS "descuentos";
CREATE TABLE "descuentos" ("Nombre" VARCHAR, "Cantidad" DOUBLE, "id_descuentos" INTEGER PRIMARY KEY  AUTOINCREMENT  NOT NULL );
DROP TABLE IF EXISTS "empleado";
CREATE TABLE "empleado" (
	`id`	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	`dui`	CHAR(12),
	`nombre`	TEXT NOT NULL,
	`edad`	INT NOT NULL,
	`direccion`	CHAR(50),
	`nit`	CHAR(14),
	`salario`	REAL,
	`id_depto`	INTEGER,
	`imagen`	BLOB
);
DROP TABLE IF EXISTS "pago_empleados";
CREATE TABLE "pago_empleados" ("id_pago_empleados" INTEGER PRIMARY KEY  NOT NULL ,"descuento_afp" DOUBLE,"descuento_isss" DOUBLE,"renta" DOUBLE,"salario_neto" DOUBLE,"id_empleado" INTEGER);
DROP TABLE IF EXISTS "tramos_renta";
CREATE TABLE "tramos_renta" ("id_tramo" INTEGER PRIMARY KEY  AUTOINCREMENT  NOT NULL , "nombre" VARCHAR, "desde" DOUBLE, "hasta" DOUBLE, "porAplicar" DOUBLE, "excento_renta" DOUBLE, "cuota_fija" DOUBLE);
